         Integer(kind=int64), intent(in):: i1, i2
         type(Dual32_2_1):: y
         Integer(kind=kind(i1)):: i_mid
         if(i1 + blocksize > i2)then
            y = sum_seq_32_2_1_1(x, i1, i2)
         else
            i_mid = (i1 + i2)/2
            y &
               = sum_pairwise_32_2_1_1(x, i1, i_mid) &
               + sum_pairwise_32_2_1_1(x, i_mid + 1, i2)
