            fn_p1 = (exp(xf))
            y%g = fn_p1*x%g
               y%h = fn_p1*x%h
                  fn_p2 = (exp(xf))
                        fn_p2_xj = fn_p2*x%g(1)
                           y%h((1 + 1*(1 - 1) - (1*(1 - 1))/2)) = y%h((1 + 1*(1 - 1) - (1*(1 - 1))/2)) + fn_p2_xj*x%g(1)
         end function exp_32_2_1
         elemental function log_32_2_1(x) result(y)
            type(Dual32_2_1), intent(in):: x
