                  Real(kind=real32):: fn_p2, fn_p2_xj
            xf = x%f
            y%f = log(xf)
            fn_p1 = (1/(xf))
            y%g = fn_p1*x%g
               y%h = fn_p1*x%h
                  fn_p2 = (-1/(xf)**2)
                        fn_p2_xj = fn_p2*x%g(1)
                           y%h((1 + 1*(1 - 1) - (1*(1 - 1))/2)) = y%h((1 + 1*(1 - 1) - (1*(1 - 1))/2)) + fn_p2_xj*x%g(1)
