         elemental function mul_dd_32_32_2_1(x, y) result(z)
            type(Dual32_2_1), intent(in):: x
            type(Dual32_2_1), intent(in):: y
            type(Dual32_2_1):: z
            Real(kind=real32):: xf, yf
               Real(kind=real32):: xj, yj
            xf = x%f
            yf = y%f
            z%f = xf*yf
            z%g = x%g*yf + y%g*xf
                     xj = x%g(1)
                     yj = y%g(1)
                        z%h((1 + 1*(1 - 1) - (1*(1 - 1))/2)) = x%h((1 + 1*(1 - 1) - (1*(1 - 1))/2))*yf + y%h((1 + 1*(1 - 1) - (1*(1 - 1))/2))*xf + x%g(1)*yj + y%g(1)*xj
         end function mul_dd_32_32_2_1
         elemental function div_dd_32_32_2_1(x, y) result(z)
            type(Dual32_2_1), intent(in):: x
            type(Dual32_2_1), intent(in):: y
            type(Dual32_2_1):: z
            Real(kind=real32):: xf, yf, div_y, div_y2, x_div_y2, fn_py
               Real(kind=real32):: xj, yj, fn_pxy, fn_pyy, fn_pxx_xj_add_fn_pxy_yj, fn_pyx_xj_add_fn_pyy_yj
            xf = x%f
            yf = y%f
            div_y = 1/yf
            z%f = xf*div_y
            ! fn_px = div_y
            div_y2 = div_y*div_y
            x_div_y2 = xf*div_y2
            fn_py = -x_div_y2
            z%g = x%g*div_y + y%g*fn_py
               ! fn_pxx = 0
               fn_pxy = -div_y2
               fn_pyy = 2*x_div_y2*div_y
                     xj = x%g(1)
                     yj = y%g(1)
                     fn_pxx_xj_add_fn_pxy_yj = fn_pxy*yj ! + fn_pxx*xj
                     fn_pyx_xj_add_fn_pyy_yj = fn_pxy*xj + fn_pyy*yj
                        z%h((1 + 1*(1 - 1) - (1*(1 - 1))/2)) = x%h((1 + 1*(1 - 1) - (1*(1 - 1))/2))*div_y + y%h((1 + 1*(1 - 1) - (1*(1 - 1))/2))*fn_py + x%g(1)*fn_pxx_xj_add_fn_pxy_yj + y%g(1)*fn_pyx_xj_add_fn_pyy_yj
         end function div_dd_32_32_2_1
         elemental function pow_dd_32_32_2_1(x, y) result(z)
            type(Dual32_2_1), intent(in):: x
            type(Dual32_2_1), intent(in):: y
            type(Dual32_2_1):: z
            Real(kind=real32):: xf, yf, fn_px, fn_py, x_pow_y, x_pow_y_sub_1, log_x
               Real(kind=real32):: xj, yj, fn_pxx, fn_pxy, fn_pyy, fn_pxx_xj_add_fn_pxy_yj, fn_pyx_xj_add_fn_pyy_yj
            xf = x%f
            yf = y%f
            x_pow_y = xf**yf
            z%f = x_pow_y
            ! this is not mathematically correct but might be useful enough in practice.
            ! todo: `0**0`
            if(xf == 0) return
            x_pow_y_sub_1 = xf**(yf - 1)
            fn_px = yf*x_pow_y_sub_1
            log_x = log(xf)
            fn_py = log_x*x_pow_y
            z%g = x%g*fn_px + y%g*fn_py
               fn_pxx = yf*(yf - 1)*xf**(yf - 2)
               fn_pxy = (1 + yf*log_x)*x_pow_y_sub_1
               fn_pyy = log_x*fn_py ! = log_x**2*x_pow_y
                     xj = x%g(1)
                     yj = y%g(1)
