            xf = x%f
            yf = y%f
            x_pow_y = xf**yf
            z%f = x_pow_y
            ! this is not mathematically correct but might be useful enough in practice.
            ! todo: `0**0`
            if(xf == 0) return
            x_pow_y_sub_1 = xf**(yf - 1)
            fn_px = yf*x_pow_y_sub_1
            log_x = log(xf)
            fn_py = log_x*x_pow_y
            z%g = x%g*fn_px + y%g*fn_py
               fn_pxx = yf*(yf - 1)*xf**(yf - 2)
               fn_pxy = (1 + yf*log_x)*x_pow_y_sub_1
               fn_pyy = log_x*fn_py ! = log_x**2*x_pow_y
                     xj = x%g(1)
                     yj = y%g(1)
                     fn_pxx_xj_add_fn_pxy_yj = fn_pxx*xj + fn_pxy*yj
                     fn_pyx_xj_add_fn_pyy_yj = fn_pxy*xj + fn_pyy*yj
                        z%h((1 + 2*(1 - 1) - (1*(1 - 1))/2)) = x%h((1 + 2*(1 - 1) - (1*(1 - 1))/2))*fn_px + y%h((1 + 2*(1 - 1) - (1*(1 - 1))/2))*fn_py + x%g(1)*fn_pxx_xj_add_fn_pxy_yj + y%g(1)*fn_pyx_xj_add_fn_pyy_yj
                        z%h((2 + 2*(1 - 1) - (1*(1 - 1))/2)) = x%h((2 + 2*(1 - 1) - (1*(1 - 1))/2))*fn_px + y%h((2 + 2*(1 - 1) - (1*(1 - 1))/2))*fn_py + x%g(2)*fn_pxx_xj_add_fn_pxy_yj + y%g(2)*fn_pyx_xj_add_fn_pyy_yj
                     xj = x%g(2)
                     yj = y%g(2)
                     fn_pxx_xj_add_fn_pxy_yj = fn_pxx*xj + fn_pxy*yj
                     fn_pyx_xj_add_fn_pyy_yj = fn_pxy*xj + fn_pyy*yj
                        z%h((2 + 2*(2 - 1) - (2*(2 - 1))/2)) = x%h((2 + 2*(2 - 1) - (2*(2 - 1))/2))*fn_px + y%h((2 + 2*(2 - 1) - (2*(2 - 1))/2))*fn_py + x%g(2)*fn_pxx_xj_add_fn_pxy_yj + y%g(2)*fn_pyx_xj_add_fn_pyy_yj
