      pure recursive function sum_pairwise_64_1_5_1(x, i1, i2) result(y)
         Integer(kind=int32), parameter:: blocksize = 2**5
         type(Dual64_1_5), intent(in):: x(:)
         Integer(kind=int64), intent(in):: i1, i2
         type(Dual64_1_5):: y
         Integer(kind=kind(i1)):: i_mid
         if(i1 + blocksize > i2)then
            y = sum_seq_64_1_5_1(x, i1, i2)
         else
            i_mid = (i1 + i2)/2
            y &
               = sum_pairwise_64_1_5_1(x, i1, i_mid) &
               + sum_pairwise_64_1_5_1(x, i_mid + 1, i2)
