            type(Dual64_1_5), intent(in):: x
            type(Dual32_1_5), intent(in):: y
            type(Dual64_1_5):: z
            Real(kind=real64):: xf, yf, div_y, div_y2, x_div_y2, fn_py
            xf = x%f
            yf = y%f
            div_y = 1/yf
            z%f = xf*div_y
            ! fn_px = div_y
            div_y2 = div_y*div_y
            x_div_y2 = xf*div_y2
