            xf = x%f
            yf = y%f
            div_y = 1/yf
            z%f = xf*div_y
            ! fn_px = div_y
            div_y2 = div_y*div_y
            x_div_y2 = xf*div_y2
            fn_py = -x_div_y2
            z%g = x%g*div_y + y%g*fn_py
               ! fn_pxx = 0
               fn_pxy = -div_y2
               fn_pyy = 2*x_div_y2*div_y
                     xj = x%g(1)
                     yj = y%g(1)
