                        z%h((5 + 5*(1 - 1) - (1*(1 - 1))/2)) = x%h((5 + 5*(1 - 1) - (1*(1 - 1))/2))*fn_px + y%h((5 + 5*(1 - 1) - (1*(1 - 1))/2))*fn_py + x%g(5)*fn_pxx_xj_add_fn_pxy_yj + y%g(5)*fn_pyx_xj_add_fn_pyy_yj
