      pure recursive function sum_pairwise_128_1_8_1(x, i1, i2) result(y)
         Integer(kind=int32), parameter:: blocksize = 2**5
         type(Dual128_1_8), intent(in):: x(:)
         Integer(kind=int64), intent(in):: i1, i2
         type(Dual128_1_8):: y
         Integer(kind=kind(i1)):: i_mid
         if(i1 + blocksize > i2)then
            y = sum_seq_128_1_8_1(x, i1, i2)
