            xf = x%f
            yf = y%f
            z%f = xf*yf
            z%g = x%g*yf + y%g*xf
                     xj = x%g(1)
                     yj = y%g(1)
                        z%h((1 + 2*(1 - 1) - (1*(1 - 1))/2)) = x%h((1 + 2*(1 - 1) - (1*(1 - 1))/2))*yf + y%h((1 + 2*(1 - 1) - (1*(1 - 1))/2))*xf + x%g(1)*yj + y%g(1)*xj
                        z%h((2 + 2*(1 - 1) - (1*(1 - 1))/2)) = x%h((2 + 2*(1 - 1) - (1*(1 - 1))/2))*yf + y%h((2 + 2*(1 - 1) - (1*(1 - 1))/2))*xf + x%g(2)*yj + y%g(2)*xj
                     xj = x%g(2)
                     yj = y%g(2)
                        z%h((2 + 2*(2 - 1) - (2*(2 - 1))/2)) = x%h((2 + 2*(2 - 1) - (2*(2 - 1))/2))*yf + y%h((2 + 2*(2 - 1) - (2*(2 - 1))/2))*xf + x%g(2)*yj + y%g(2)*xj
