         elemental function div_dd_128_128_2_2(x, y) result(z)
            type(Dual128_2_2), intent(in):: x
            type(Dual128_2_2), intent(in):: y
            type(Dual128_2_2):: z
            Real(kind=real128):: xf, yf, div_y, div_y2, x_div_y2, fn_py
               Real(kind=real128):: xj, yj, fn_pxy, fn_pyy, fn_pxx_xj_add_fn_pxy_yj, fn_pyx_xj_add_fn_pyy_yj
            xf = x%f
            yf = y%f
            div_y = 1/yf
            z%f = xf*div_y
            ! fn_px = div_y
            div_y2 = div_y*div_y
            x_div_y2 = xf*div_y2
            fn_py = -x_div_y2
            z%g = x%g*div_y + y%g*fn_py
               ! fn_pxx = 0
               fn_pxy = -div_y2
               fn_pyy = 2*x_div_y2*div_y
                     xj = x%g(1)
                     yj = y%g(1)
                     fn_pxx_xj_add_fn_pxy_yj = fn_pxy*yj ! + fn_pxx*xj
                     fn_pyx_xj_add_fn_pyy_yj = fn_pxy*xj + fn_pyy*yj
                        z%h((1 + 2*(1 - 1) - (1*(1 - 1))/2)) = x%h((1 + 2*(1 - 1) - (1*(1 - 1))/2))*div_y + y%h((1 + 2*(1 - 1) - (1*(1 - 1))/2))*fn_py + x%g(1)*fn_pxx_xj_add_fn_pxy_yj + y%g(1)*fn_pyx_xj_add_fn_pyy_yj
                        z%h((2 + 2*(1 - 1) - (1*(1 - 1))/2)) = x%h((2 + 2*(1 - 1) - (1*(1 - 1))/2))*div_y + y%h((2 + 2*(1 - 1) - (1*(1 - 1))/2))*fn_py + x%g(2)*fn_pxx_xj_add_fn_pxy_yj + y%g(2)*fn_pyx_xj_add_fn_pyy_yj
                     xj = x%g(2)
                     yj = y%g(2)
                     fn_pxx_xj_add_fn_pxy_yj = fn_pxy*yj ! + fn_pxx*xj
                     fn_pyx_xj_add_fn_pyy_yj = fn_pxy*xj + fn_pyy*yj
                        z%h((2 + 2*(2 - 1) - (2*(2 - 1))/2)) = x%h((2 + 2*(2 - 1) - (2*(2 - 1))/2))*div_y + y%h((2 + 2*(2 - 1) - (2*(2 - 1))/2))*fn_py + x%g(2)*fn_pxx_xj_add_fn_pxy_yj + y%g(2)*fn_pyx_xj_add_fn_pyy_yj
